<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Localized Ad Finder</title>
    <style>
        body {
            font-family: Arial, sans-serif;
            text-align: center;
            margin: 0;
            padding-top: 0px;
            padding-bottom: 10px;
            padding-left: 10px;
            padding-right: 10px;
            overflow: hidden;

        }
        #video-container {
            margin-top: 20px;
        }
        video, img {
            width: 95%;
            max-width: 854px;
            margin-top: 20px;
            border: 10px solid #c7c7c7;
        }
        input[type="text"] {
            padding: 10px;
            width: 200px;
            font-size: 16px;
        }
        button {
            padding: 10px 20px;
            font-size: 16px;
            cursor: pointer;
            margin: 5px;

        }
        #store-details {
            margin-top: 20px;
            text-align: left;
            display: inline-block;
        }

        /* Mobile-specific styles */
        @media (max-width: 768px) {
            #video-container video, #video-container img {
                margin-top: 0;
                border: none;
                width:100%;
            }
            video {
                controls: none;
                pointer-events: auto;
            }

        }
    </style>
</head>
<body>
    <h3>Enter a zip code to play the ad with the localized chaser.</h3>
    <input type="text" id="zipcode" maxlength="5" placeholder="Enter 5-digit zip code" onkeypress="if(event.key === 'Enter') findLocalizedAd();">
    <button onclick="findLocalizedAd()">Play Localized Ad</button>
    <button onclick="pickRandomAd()">Pick Random</button>
    <div id="video-container">
        <img src="https://static.originmedia.tv/macys-25_spring_vip/sitepagethumbs/thumb1.jpg" alt="Placeholder Image">
    </div>
    <div id="store-details"></div>

        function findLocalizedAd() {
            const zipInput = document.getElementById("zipcode").value;

            // Validate the zip code
            if (!/^\d{5}$/.test(zipInput)) {
                const storeDetails = document.getElementById("store-details");
                storeDetails.innerHTML = "<p style='color: red;'>Enter a 5 digit zip code only.</p>";
                return;
            }

            executeZipSearch(zipInput);
        }

        function findLocalizedAdByZip(zip) {
            executeZipSearch(zip);
        }

        function pickRandomAd() {
            const zipCodes = Object.keys(videoData);
            const randomZip = zipCodes[Math.floor(Math.random() * zipCodes.length)];
            document.getElementById("zipcode").value = randomZip; // Update input field with random zip code
            executeZipSearch(randomZip);
        }

        function executeZipSearch(zipInput) {
            const videoContainer = document.getElementById("video-container");
            const storeDetails = document.getElementById("store-details");

            videoContainer.innerHTML = ""; // Clear previous video
            storeDetails.innerHTML = ""; // Clear previous details

            if (exclusionList.includes(zipInput)) {
                storeDetails.innerHTML = "<p style='color: red;'>The zip code you entered was found on the campaign exclusion list.</p>";
                return;
            }

            if (videoData[zipInput]) {
                const { filename, storeNumber } = videoData[zipInput];
                const videoUrl = `https://static.originmedia.tv/macys-25_spring_vip/ads_with_localized_chasers/ad1/${filename}`;
                // Display video
const videoElement = `
    <video autoplay playsinline controls>
        <source src="${videoUrl}" type="video/mp4">
        Your browser does not support the video tag.
    </video>`;
                videoContainer.innerHTML = videoElement;

                // Display store details
                if (storeData[storeNumber]) {
                    const details = storeData[storeNumber];
                    const detailHTML = Object.entries(details)
                        .map(([key, value]) => `<p><strong>${key}:</strong> ${value}</p>`)
                        .join("\n");
                    storeDetails.innerHTML = detailHTML;
                } else {
                    storeDetails.innerHTML = "<p style='color: red;'>No store details found for the associated store number.</p>";
                }
            } else {
                const fallbackVideoUrl = "https://static.originmedia.tv/macys-25_spring_vip/ads_with_non_localized_chasers/macys-25_spring_vip-non_localized_1.mp4";
                const fallbackText = "Specified zip code is outside of the localized store radius search. Displaying non-localized ad instead.";

                // Display fallback video
                const fallbackVideoElement = `
                    <video autoplay playsinline onclick="this.paused ? this.play() : this.pause();">
                        <source src="${fallbackVideoUrl}" type="video/mp4">
                        Your browser does not support the video tag.
                    </video>`;
                videoContainer.innerHTML = fallbackVideoElement;

                // Display fallback text
                storeDetails.innerHTML = `<p style='color: red;'>${fallbackText}</p>`;
            }
        }
    </script>
